import React from 'react';
import './index.css';
const Brand = () => {
  return (
    <>
    <div className='Brand'> 
      <img src='./images/VasitumLogo.png' alt='logo'></img>
    </div>
    <div className='Brand2'> 
      <img src='./images/smallVasitumLogo.png' alt='logo'></img>
    </div>
    </>
  )
}

export default Brand
